import { Provider, useDispatch, useSelector } from "react-redux"
import { useState } from "react";
// import { WITH_DIPOSED_MONAY, WITH_DROW_MONAY } from "./rtk/slice/bank";
import { store } from "./rtk/store";
import { WITHDIPOSEDMONAY, WITHDROWMONAY } from "./rtk/slice/bank";
function App(){
const [state2,setstate]=useState(0)
const reduser=useSelector(state=>state.bank)
console.log(reduser);
const dispatch=useDispatch()
return(
    <Provider store={store}>
<div className="App">
<p>{reduser}</p>
<input onChange={(e)=>setstate(e.target.value)} type="text"placeholder="Monay"></input>
<button onClick={()=>dispatch(WITHDROWMONAY(100))}>WITHDORW_MANY</button>
<button onClick={()=>dispatch(WITHDIPOSEDMONAY(state2*1))}>DIPOSED_MONAY</button>

</div>
</Provider>
)
}
export default App
